import React, {useEffect, useState} from 'react';
import './App.css';

function App() {
  var [currentQuestion, setCurrentQuestion] = useState("");
  var [currentQuestioner, setCurrentQuestioner] = useState("");
  var [previewQuestion, setPreviewQuestion] = useState("");
  var [previewQuestioner, setPreviewQuestioner] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=5&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setPreviewQuestioner(data.values[0][0]);
        setPreviewQuestion(data.values[0][1]);
      })
    );
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setCurrentQuestioner(data.values[0][0]);
        setCurrentQuestion(data.values[0][1]);
      })
    );
  }, [])

  return (
    <div className="App">
     <div className="Controls">
      <form className="Control_Object">
        <label>
          Form Link
         <input className="Control_Object" type="text" name="preview" />
        </label>
     </form>
      <form className="Control_Object">
        <label>
          Preview Question
         <input className="Control_Object" type="text" name="preview" />
        </label>
        <input className="Control_Object" type="submit" value="Update Preview" />
     </form>
      <button className="Control_Object" onClick={function() { alert('click'); setCurrentQuestion("dad"); }}>
        Answer
      </button>
      <button className='Control_Object' onClick={function() {
        setCurrentQuestioner({previewQuestioner});
        setCurrentQuestion({previewQuestion});
        fetch("http://localhost:5000/?question=5&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
         response.json().then(data => {
           console.log(data);
            setPreviewQuestioner(data.values[0][0]);
            setPreviewQuestion(data.values[0][1]);
          })
        );
        }}>
        Skip
      </button>
     </div>
     <div className="Preview">
      <p className="previewQuestioner">WWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWW</p>
      <p className="previewQuestion">WWWWWWWWWWW WWWWWWWWWWWW WWWWWWWWWWWWWWWWWWW WWWWWWWWWWWWWWWWWWWWW WWWWWWWWWWWWWWWW WWWWWWWWWWWWWWWWWWWW WWWWWWWWWWWWWWWWWWWWWWW WWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWWW</p>
     </div>
     <div className="Live">
      <p className="currentQuestioner">{currentQuestioner}</p>
      <p className="currentQuestion">{currentQuestion}</p>
     </div>
    </div>
  );
}

export default App;
